import logo from './logo.svg';
import search_image from './search.png';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <a href="#goto" class="headerButton">Go To</a>
        <div class="headerButton-left">
          <a href="" class="headerButton"><img src={logo} className="App-logo" alt="logo" /></a>
          <a href="#browse_stream" class="headerButton">Browse Stream</a>
        </div>

        <link rel="stylesheet" href="https://cdnjs.cloudflare.com/ajax/libs/font-awesome/4.7.0/css/font-awesome.min.css"></link>
        <div class="search">
          <form action="/" method="GET" class="form">
            <input type="text" placeholder="Search"></input>
            <button type="submit"><i class="fa fa-search"></i></button>
          </form>
        </div>

        <div class="headerButton-right">
          <a href="#log_in" class="headerButton">Log in</a>
          <a href="#sign_up" class="headerButton">Sign Up</a>  
        </div>
         
      </header>
    </div>
  );
}

export default App;
